<div>
    <MainMenu uInfo={userInfo}></MainMenu> 
    
    <div class="container-xl" >
        
        <div class="table-responsive">
            
            <div class="table-wrapper">   
            <div class="table-title">
                <div class="row">
                    <div class="col-sm-6"><h2>Manage <b>Bookings</b></h2></div>
                    <div class="col-sm-6">
                        <div class="btn-group" data-toggle="buttons">
                            <button  class="btn btn-info active" type="radio" name="status" value="all" checked="checked"> All </button>
                            <button  class="btn btn-success" type="radio" name="status" value="active"> Active </button>
                            <button  className="btn btn-warning" type="radio" name="status" value="expired"> Expired </button>
                        </div>
                    </div>
                </div>
            </div>
            <table class="table table-striped table-hover">
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Building</th>
                        <th>Booking Date</th>
                        <th>Floor</th>
                        <th>Space cod</th>
                        <th>Status</th> 
                        <th>Action</th>
                    </tr>
                </thead>
                {fetchedDataActie?.map((b) =>        
                    <tbody>
                        <tr>
                        <th>Active</th>
                        <td>{b.address}</td>
                        <td>{moment(b.date).format('yyyy/MM/DD')}</td>
                        <td>{b.floor}</td>
                        <td>{b.desk}</td>
                        </tr>
                    </tbody>
                )}
            </table>
        </div> 
    </div>   
</div> 
</div>

